/*View structure for view bi_closure */

/*!50001 DROP TABLE IF EXISTS `bi_closure` */;
/*!50001 DROP VIEW IF EXISTS `bi_closure` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `bi_closure` AS select `c`.`closureId` AS `closureId`,`l`.`closureLineId` AS `closureLineId`,`c`.`closureDate` AS `Fecha_Cierre`,`l`.`pwId` AS `pwId`,`l`.`estimate` AS `Porcentaje_Calculado`,`l`.`done` AS `Porcentaje_Real`,`l`.`amount` AS `Coste_Calculado` from (`closure` `c` join `closure_line` `l` on((`l`.`closureId` = `c`.`closureId`))) where (`c`.`close` = 1) */;

