/*View structure for view bi_wo */

/*!50001 DROP TABLE IF EXISTS `bi_wo` */;
/*!50001 DROP VIEW IF EXISTS `bi_wo` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `bi_wo` AS select `w`.`pwId` AS `pwId`,`w`.`woId` AS `woId`,`l`.`woLineId` AS `woLineId`,`w`.`initDate` AS `Fecha_Trabajo`,`l`.`cunitId` AS `cunitId`,`l`.`quantity` AS `Cantidad`,(select (`u`.`cost` * `u`.`k`) from `pw_line` `u` where ((`u`.`cunitId` = `l`.`cunitId`) and (`u`.`pwId` = `w`.`pwId`)) limit 1) AS `Coste` from (`wo` `w` join `wo_line` `l` on((`l`.`woId` = `w`.`woId`))) */;

